function Resume(){
    return(
        <section className="my-3">
            <h2>Resume</h2>
            <p>Download my resume here <span href="https://docs.google.com/document/d/1gU5XflUFWsucu_gZsXpsxjS7mbhV3QjH/edit?usp=sharing&ouid=117658244105350147754&rtpof=true&sd=true"></span></p>
            </section>
    )
}

export default Resume;
